import React from "react";
import { useQuery } from "react-query";
import TotalCard from "./TotalCard/TotalCard";
import GenCards from "./GenCards/GenCards";
import "./OverviewSection.css";


const endpoint = "https://leetcode.com/graphql/";
  const LeetCode_Query = `
  { matchedUser(username: "tush27") {
    username
    submitStats: submitStatsGlobal {
    acSubmissionNum {
    difficulty
    count
    }
    }
    }
    }`;




function OverviewSection() {

  const { data, isLoading, error } = useQuery("launches", () => {
    return fetch(endpoint, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ query: LeetCode_Query })
    })
      .then((response) => {
        if (response.status > 400) {
          throw new Error("Error fetching data");
        } else {
          return response.json();
        }
      })
      .then((data) => data.data);
  });

  if (isLoading) return "Loading...";
  if (error) return <pre>hii {error.message}</pre>;

  console.log(data);




    return (
    <div className="overview">
      <TotalCard />
      <GenCards props={{ title: "Easy", que: "100", imgUrl: "#" }} />
      <GenCards props={{ title: "Medium", que: "200", imgUrl: "#" }} />
      <GenCards props={{ title: "Hard", que: "300", imgUrl: "#" }} />
    </div>
  );
}

export default OverviewSection;
